<!DOCTYPE html>

  <meta name="viewport" content="width=device-width, initial-scale=1">

<body>
  <script>
    (function (window, document) {
      if (window.babble) {
        console.error('babble embed already included');
        return;
      }
      window.babble = {},
        m = ['init'];
      window.babble._c = [];
      m.forEach(me => window.babble[me] = function () {
        window.babble._c.push([me, arguments])
      });
      var elt = document.createElement('script');
      elt.type = "module";
      elt.async = true;
      //shim src for integration
      elt.src = "shim.js";
      var before = document.getElementsByTagName('script')[0]; before.parentNode.insertBefore(elt, before);
    })(window, document, undefined);
    babble.init('fdsq');
  </script>
</body>

</html>
